import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import MyNarbar from './myNavbar';
import Figure from 'react-bootstrap/Figure';
import explorer from './explorer.png';

const Home = () => {
  return (
    <>
      <MyNarbar />
      <div styles={{ backgroundImage: `url(${explorer})`}}>
        Heres my image
      </div>
      <Figure>
        <Figure.Image
          src="explorer.png"
          alt="explorer photo"
          width="100%"
          style={{display: "block", marginBottom: 0}}
        />
      </Figure>
    </>
  );
}

export default Home;
